B.AQ=new A.as("Full-Screen launcher","Usability improvements",'An early Full-Screen frontend is now available. You can access it using a new "Go Full-Screen" button in the Flutter App or by navigating to fullscreen.app.teslaandroid.com. \n\nThe Virtual Display still needs to fill the entire window, and there might be some minor UI issues in the Flutter App.')
