B.Bz=new A.as("Virtual display","Performance improvements","The virtual display is now hardware accelerated via the V4L2 API. As a result, this solution behaves consistently regardless of CPU usage (gaming, video playback).\n\nThe capture mechanism has also been replaced. The new solution sends data to the browser less frequently if nothing is happening on the display. As a result, overall resource usage of the front end is significantly reduced in typical use.\n\nInternally the refresh rate of the headless operation mode in drm_hwcomposer is now capped at 30Hz. The SufraceFlinger is not able to provide more frames to the virtual display(buffer allocation related).\n\nSystem animation duration is now reduced to improve performance.\n\nVirtual display window scaling has been modified to slightly increase text size in system apps; it makes them more easily readable when driving.")
B.Ap=new A.as("Browser audio","Usability improvements","Version 2023.18.1 adds the ability to control the sound settings in the Flutter app. The feature can be disabled if you intend to use Bluetooth Audio or other peripherals.")
B.Bo=new A.as("Virtual touchscreen","Multitouch support","Multitouch support is now available in Tesla Android. The overall stability of the component has been increased.")
B.Aw=new A.as("Android Platform","Boot time optimization","Version 2023.18.1 takes ~2/3x less time to boot when compared to other Android 13 releases.")
B.AP=new A.as("Android Platform","Support for OTA updates","Version 2023.18.1 adds support for OTA updates. A/B (Seamless) mechanism ensures a safe installation with a rollback to the previous build in case of failure. The process takes place in the background; you can use Tesla Android when the update is being installed.\n\nNavigate to Settings -> System -> Updater to check update availability in the future.\n\nUpdates are not incremental. You can skip a few versions and update directly to the newest build.\n\nOnly online updates are available in this release; connect your Raspberry Pi to your home router with an Ethernet cable to avoid data charges. Each update weighs around 1 GB.")
B.Ba=new A.as("Single image install","Usability improvements","The bootloader has been updated to support the single-image install process better. In addition, the filesystem will now expand to take advantage of the entire SD Card on the first boot(similar to how Raspbian behaves).\n\nAny SD Card over 16GB will work with Tesla Android, but 64GB is recommended.\n\nThe download size has been significantly reduced, and the manual installation procedure has been deprecated and removed from the website. ")
B.AV=new A.as("Bluetooth","Usability improvements","Version 2023.18.1 fixes problems with Bluetooth Low Energy. You can now use wireless game controllers, OBD interfaces, and more. Bluetooth Audio stability is also improved.")
B.AI=new A.as("Android Platform","Stability improvements","Android has been updated to Android 13 release 41 with the latest security patches. The platform is now in sync with the latest GloDroidCommunity AOSP base. All the board-related changes have been sent upstream, and Tesla Android was migrated to a new build mechanism to make future Android platform updates faster.")
B.Au=new A.as("Flutter App","Usability improvements","The has been reorganized to make room for new modules. Tapping the version ribbon takes you to the screen with multiple tabs. One of them is the new Settings module, where you can control the browser audio.")
B.Bg=new A.as("Video playback","Performance improvements","Version 2023.18.1 adds AV1 decoding via ffmpeg_codec2. The new component takes advantage of multiple cores and performs better.")
