B.Bs=new A.as("Google Apps","Usability improvements","Version 2022.45.1 brings back Google Play Store and other Google Services that were removed in 2022.25.1. Device ID registration for Google Play is not longer required. Not all apps can be installed using Google Play Store due to lack of device certification, they need to be installed manually.")
B.Bf=new A.as("Android Platform","Stability improvements","Tesla Android system services initialisation has been improved, all components(web server, touchscreen, display etc.) will automatically restart on failure. In previous versions a full system reboot would be needed in this scenario.")
B.AD=new A.as("Virtual display","DRM playback","Version 2022.45.1 fixes DRM video playback and enables access to secure layers that are usually blacked out in screen capture.")
B.AF=new A.as("CarPlay","Visual improvements","Three row layout for CarPlay is now selected as default.")
