B.AC=new A.as("Google Play Store","App discoverability","Google Play Store has been replaced with Aurora Store, an Open Source alternative that includes Device Spoofing(emulating Google certification).\n\nGoogle Play Services have been replaced with microG(Open Source Google Apps).\n\nFDroid(Open Source App Store that does not rely on Google Play Store) is also included.")
